import React from 'react';
import { Card, CardText, CardBody, CardTitle, CardSubtitle } from 'reactstrap';
import { Container, Col } from 'reactstrap';
import Ethereum from '../assets/ethereum.svg';
import { Button } from 'reactstrap';

const Manage = () => {
    return (
        <div>
            <Card className="background-shadow">
                <CardBody>
                    <CardTitle tag="h1">Manage The Lottery</CardTitle>
                    <CardSubtitle tag="h3" className="mb-2 text-muted">Manager Section Only!</CardSubtitle>
                </CardBody>
                <div style={{ textAlign: 'center' }}>
                    <img width="5%" src={Ethereum} alt="Card image cap" />
                </div>
                <CardBody>
                    <CardText tag="h4">This section is specific to the Manager of this Lottery. Any
            individual other then the manager would fail to pick.</CardText>
            &emsp;
                    <Button outline color="primary">Pick Winner!</Button>{' '}
                </CardBody>
            </Card>
        </div>
    )
}

export default Manage;
